    line-height: 36px;

    & :first-child {
      margin-bottom: 20px;
    }
  }

  @media (max-width: 800px) {
    flex-direction: column;
    align-items: center;

    &__info {
      margin-bottom: 20px;

      &:nth-child(-n+2) {
        margin-bottom: 10px;
      }
    }

    &__forms {
      margin: 0;
    }
  }

  @media (max-width: 499px) {
    &__info {
      font-size: 18px;
      line-height: 26px;
    }
  }
}

